import React from "react";
import "./App.css";
import Register from "./pages/Register";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/" element={"Hi"} />
          <Route exact path="/Register">
            <Register />
          </Route>
        </Routes>
      </Router>
    </div>
  );
}
export default App;
